var extract = function (point, keyIndex, keysArray) {
    if (keyIndex < keysArray.length) {
        let element = keysArray[keyIndex];
        if (typeof point[element] !== 'object') {
            let simpleValue = {};
            simpleValue[element] = point[element];
            return simpleValue
        } else {
            keyIndex = keyIndex + 1;
            return extract(point[element], keyIndex, keysArray);

        }

    }

}

