let updateSubmodelElementValues = function (submodelElements, indexIdPath, collectionIds, value) {

    if (indexIdPath < collectionIds.length) {

        let idPath = collectionIds[indexIdPath];

        for (let submodelElement in submodelElements) {

            let submodelElementIdentifier = submodelElements[submodelElement].idShort;

            let modelType = submodelElements[submodelElement].modelType.name;

            if (submodelElementIdentifier === idPath && modelType === "SubmodelElementCollection" && indexIdPath < (collectionIds.length - 1)) {

                indexIdPath = indexIdPath + 1;

                return updateSubmodelElementValues(submodelElements[submodelElement].value, indexIdPath, collectionIds, value);

            } else if (submodelElementIdentifier === idPath && modelType === "SubmodelElementCollection" && indexIdPath === (collectionIds.length - 1)) {

                //msg.debug3 = "entrei";

                let values = JSON.parse(value);

                let keys = Object.keys(values);


                for (let keyIndex in keys) {

                    let selectedValue = 0;

                    selectedValue = values[keys[keyIndex]];

                    submodelElements[submodelElement].value[keyIndex].value = selectedValue;

                }

                return true;

            }
            else if (submodelElementIdentifier === idPath && modelType === "Property") {

                submodelElements[submodelElement].value = value;

                return true;

            }

        }

    } else {

        return false;

    }

}

